export default (function(a,b,c,d,e,f,g,h,i,j){return {data:{BZBgZPd26q:{data:{id:903,attributes:{imdbId:"tt0285531",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMjEzNDk5MTg4NV5BMl5BanBnXkFtZTYwNzI4Mzg2._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"5.5\u002F10"},{Source:"Rotten Tomatoes",Value:"28%"},{Source:"Metacritic",Value:"35\u002F100"}],item_lang:{data:{id:1566,attributes:{title:b,plot:"Four childhood friends, Jonesy, Beaver, Pete and Henry all share a special secret. Each year, they take a trip into Maine woods. This year is different. A blizzard occurs, and they recover a man found wandering around. Unbeknownst to them, this wandering individual isn't the only being to be found. Now they must act fast to stop the outbreak developing and to prevent the world from its doom.",slug:"dreamcatcher"}}},books:{data:[{id:5432,attributes:{title:b,description:e,thumbnail:f,authors:[a],firstBook:true,published:g,publisher:h,subtitle:i}},{id:5433,attributes:{title:b,description:"Au cœur de la forêt de Derry, quatre amis d'enfance, unis pour le meilleur et pour le pire, confrontés à un phénomène terrifiant qu'ils ne risquent pas d'oublier... Stephen King, au sommet de son talent, cerne au plus profond de l'inconscient collectif les peurs de notre temps. Dans la lignée de Ça et d'Insomnie, un très grand King.",thumbnail:c,authors:[a],firstBook:d,published:j,publisher:"Romans, Nouvelles, Recits (Dom",subtitle:c}},{id:5434,attributes:{title:"Duddits - Dreamcatcher",description:"Stephen Kings Bestseller erstmals im Heyne-Taschenbuch Vier Männer planen einen harmlosen Jagdausflug in die Wälder von Maine, der schließlich in einer bizarren tödlichen Bedrohung endet. Kann ihr alter Freund Duddits mit seinen telepathischen Fähigkeiten sie aus dem nicht enden wollenden Albtraum retten?",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=cnS-TtVb4SgC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"2013-06-04",publisher:"Heyne Verlag",subtitle:"Roman"}},{id:5435,attributes:{title:"Duddits, Dreamcatcher",description:c,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=qPLUzQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:d,published:j,publisher:c,subtitle:"ROMAN. AUS D. ENGL. V. JOCHEN SCHWARZER"}},{id:5436,attributes:{title:b,description:e,thumbnail:f,authors:[a],firstBook:d,published:g,publisher:h,subtitle:i}}]}}},meta:{}}},prerenderedAt:1680940959828}}("Stephen King","Dreamcatcher","",null,"From master storyteller Stephen King comes his classic #1 New York Times bestseller about four friends who encounter evil in the Maine woods. Twenty-five years ago, in their haunted hometown of Derry, Maine, four boys bravely stood together and saved a mentally challenged child from vicious local bullies. It was something that fundamentally changed them, in ways they could never begin to understand. These lifelong friends—now with separate lives and separate problems—make it a point to reunite every year for a hunting trip deep in the snowy Maine woods. This time, though, chaos erupts when a stranger suddenly stumbles into their camp, freezing, deliriously mumbling about lights in the sky. And all too quickly, the four companions are plunged into a horrifying struggle for survival with an otherworldly threat and the forces that oppose it...where their only chance of survival is locked into their shared past—and the extraordinary element that bonds them all...","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=AeErDgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2017-02-28","Simon and Schuster","A Novel","2002-01-01"))